import './article.css';

class Article extends React.Component{
    render(){
        return (
        <div>
            <table>
                <tr>
                    <th className="Title">Learn how to invest in cryptocurrency ...</th>
                </tr>
            </table>
            </div>
        );
    }
}


export {Article};
